    ret = sqlite3_exec (handle, "BEGIN", NULL, 0, &errMsg);
    if (ret != SQLITE_OK)
      {
	  fprintf (stderr, "%s\n", errMsg);
	  sqlite3_free (errMsg);
	  goto error;
      }

